"To rotate log files, it was assumed that a dedicated thread repeatedly calls `logRotator`. This consumes CPU power. To finish the work to make wai-logger more eco, `logRotator` is now obsoleted and log files are rotated on-demand.

@snoyberg if you kindly review this commit, it would be appreciated.
"

"Hi Simon.
Apologies for breaking your feature. I wanted to get it into an automated test so it wouldn't get broken by any future changes. Turns out my unit test was too simplistic and didn't catch the event issues you mentioned. I've been looking into automated integration test tools like Selenium, CasperJS, DalekJS etc to try get it properly tested. Setting up this kind of automation still requires some work.

One small point on the variable name `noForceCase`, any time I see a boolean named with a negative like `noSomething` or `notSomething`, I try to refactor it to avoid double negatives which make the code harder to understand.

```
var noForceCase = false;
if(!noForceCase)
    doSomething();
```

I'd normally refactor it out to be:

```
var forceCase = true;
if(forceCase)
    doSomething();
```

One other thing is that this change was the first time the library was adding to or mutating the input string. Up until now, all the features were about trimming/stripping characters, not adding/replacing characters. I've been trying to decide should this kind of functionality be taken out of the `trimAlphaNum` function and should the mutation behaviour be given it's own function. I try to follow the pattern that a function should do **"one thing and one thing only"**. So in this case I think it should only remove characters and I may add a second function `mutateAlphaNum` for replacing or adding characters.

The fact that I didn't fully understand your code kind of supports my thought that this function may now be doing a little too much and requires a bit of refactoring/simplification in order to keep the library maintainable and extensible.

Anyway, thanks for the pull request, I'm still looking at it and will try get it properly included soon.

Kev
"

"The problem with doing this is that it will overwrite the user configuration from reporterCfg.prefixes.
I think this should be done differently to allow the user customisations to remain.

e.g.

``` js
var reporterCfg = config.specReporter || {},
      isWindows = process && process.platform === 'win32';
this.prefixes = reporterCfg.prefixes || {
  success: isWindows? '\u221A ' : '✓ ',
  failure: isWindows? '\u00D7 ' : '✗ ',
  skipped: isWindows? '. ' : '- ',
};
```
