"Please note anyone using zf2 assetic module with ZfcRbac you will experience this same issue on Access Denied.  This is due to the white list of acceptable errors in assetic.  You will need to allow the firewall errors in your assetic configuration to get css on your access denied pages:

``` php
use Zend\Mvc\Application;
use ZfcRbac\Service\Rbac;

return array(
    'assetic_configuration' => array(
        'acceptableErrors' => array(
            Application::ERROR_CONTROLLER_NOT_FOUND,
            Application::ERROR_CONTROLLER_INVALID,
            Application::ERROR_ROUTER_NO_MATCH,
            Rbac::ERROR_ROUTE_UNAUTHORIZED,
            Rbac::ERROR_CONTROLLER_UNAUTHORIZED,
        ),
);
```
